INSERT INTO `v1_dc88253374936a3b259456185e0f10cff0e89eb7864041d0530c1b39da8368dc` VALUES (92421340, "ダメージ減衰", "すべてのモンスターが一度の行動で受けるダメージ値を減衰させる。ダメージ値が上昇するほど減衰率も上昇する。", 18, 1485);
INSERT INTO `v1_dc88253374936a3b259456185e0f10cff0e89eb7864041d0530c1b39da8368dc` VALUES (92421340, "ＴＰ上昇上限付与", "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", 17, 1486);
INSERT INTO `v1_dc88253374936a3b259456185e0f10cff0e89eb7864041d0530c1b39da8368dc` VALUES (92421340, "ＨＰ吸収ダウン", "バトル開始時、すべてのキャラのＨＰ吸収を中ダウンさせる。", 9, 1487);
INSERT INTO `v1_dc88253374936a3b259456185e0f10cff0e89eb7864041d0530c1b39da8368dc` VALUES (92421340, "ダメージカット", "バトル開始時、すべてのモンスターがダメージ\n10％カット状態になる。", "boss_damage_cut", 1488);
